import React from "react";
export default function StudentInfoHandler({ Info }) {
  const studentInfo = Array.from(Info);
  return (
    <table style={{ border: "1px solid black" }}>
      {studentInfo.map((val, index) => {
        <tr key={index}>
          <td>{val}</td>
        </tr>;
      })}
    </table>
  );
}
